			["customText"] = "function()\n    local Uptime = GetTime()\n    local runic = UnitPower(\"player\", SPELL_POWER_RUNIC_POWER) or 0\n    local inRange = 0\n    \n    if aura_env.startTime and aura_env.startTime > 0 then\n        aura_env.duration = string.format(\"%.1f\", (GetTime() - aura_env.startTime))\n        \n        if (runic/15 <= 2 and runic/15 > 0)then\n            --Red\n            aura_env.ticksRemaining = string.format(\"|c%s%.0f\", (\"FFE60000\"), (runic/15) - 1)\n        elseif(runic/15 <= 4 and runic/15 > 2) then\n            --Orange\n            aura_env.ticksRemaining = string.format(\"|c%s%.0f\", (\"FFE68A00\"), (runic/15) - 1)\n        elseif(runic/15 >= 4 and runic/15 < 5.6) then\n            --Green\n            aura_env.ticksRemaining = string.format(\"|c%s%.0f\", (\"FF1Aff1A\"), (runic/15) - 1)\n        elseif(runic/15 >= 5.6) then\n            --Green\n            aura_env.ticksRemaining = string.format(\"|c%s%.0f\", (\"FF38EEFF\"), (runic/15) - 1)\n        end\n        \n        if _G['breathCount'] == nil then\n            aura_env.targetCount = 0\n        else\n            aura_env.targetCount = _G['breathCount']\n        end\n        \n        --Get nearby targets ~ 8 yards\n        for i = 1, 40 do\n            local unit = \"nameplate\"..i\n            if UnitExists(unit) and not UnitIsFriend(\"player\", unit) and IsItemInRange(33278, \"nameplate\"..i) == true then\n                inRange = inRange + 1\n            end\n        end\n        \n        if(inRange < aura_env.targetCount) then\n            inRange = aura_env.targetCount\n        end\n        return aura_env.ticksRemaining\n        \n    end\n    return \"\"\nend",
